Вечерняя сводка новостей по коронавирусу:

✹ Завод Pfizer в Мичигане приступил к отправке первой партии вакцины от коронавируса;

✹ США планируют вакцинировать от коронавируса 100 000 000 человек в I квартале 2021 года;

✹ Глава Роспотребнадзора Анна Попова 13 декабря сообщила, что ведомство установило в России «нулевого пациента» с коронавирусом, с которого в стране началось распространение COVID-19;

✹ Песков опроверг слухи о существовании «президентского бункера» в Сочи;

✹ Собянин заявил, что комендантского часа в Москве в новогодние праздники не будет, а алкоголь в этот период будет продаваться без ограничений ;

✹ В Марселе прошла подпольная вечеринка с участием около 500 человек;

✹  75% жителей Албании и стран бывшей Югославии верят в теории заговора о коронавирусе — опрос;

✹ Народный артист РФ, диктор Евгений Хорошевцев умер от последствий коронавируса

